import React from 'react';

class HomeBigButton extends React.Component {

    constructor(props) {
        super(props);
        this.state = {clicked: ''};
    }

    goTo(){
        console.log('boton clickeado: '+this.props.value);
        this.setState({clicked: this.props.value});
    }


    render(){
        return (<div className={this.props.ownClass} onClick={() => this.goTo()}>
            <div className="text-button">{this.props.label}</div>
        </div>);
    }
}

export default HomeBigButton;
